    function navbarDefaultService() {
        var api = {
            url: 'pages/global-search/partials/nav-bar-default.html',
            options: {
                showErroredAttributes: false,
                showEmptyAttributes: false,
                showRequiredAttributes: false,
                showOptionalAttributes: false,
                showAllAttributes: true,
                expandAllGroups: true,
                expandActiveGroupOnly: false
            },
            dataCompleteness: {},
            calculateDataCompleteness: calculateDataCompleteness,
            showTab: null
        }

        return api;

        function calculateDataCompleteness(data) {
            api.dataCompleteness = {};
            angular.forEach(data, function(attributes, group){
                var count = 0;
                var totalAttributes = 0;
                angular.forEach(attributes, function(attribute, key){
                    if(attribute.values && attribute.values && attribute.values.length !== 0) {
                        count++;
                    }
                    totalAttributes++;
                });

                api.dataCompleteness[group] = Math.round((count/totalAttributes) * 100);
            });
        }
    }

