    navbarTemplateCreateService.$inject = ['repository']
    function navbarTemplateCreateService(repository) {
        var api = {
            url: 'pages/global-search/partials/nav-bar-create-template.html',
            templateName: null,
            selectedAttributes: {},
            addToTemplate: addToTemplate,
            cancelTemplate: cancelTemplate,
            removeFromTemplate: removeFromTemplate,
            saveTemplate: saveTemplate,
            onCancel: null,
            onTemplateSaved: null
        }

        return api;

        function addToTemplate(attribute) {
            if(!attribute.bookmarked) {

                if (api.selectedAttributes[attribute.metadata.attributeGroup] !== undefined) {
                    api.selectedAttributes[attribute.metadata.attributeGroup][attribute.metadata.id] = attribute;
                }
                else {
                    api.selectedAttributes[attribute.metadata.attributeGroup] = {};
                    api.selectedAttributes[attribute.metadata.attributeGroup][attribute.metadata.id] = attribute;
                }

                attribute.bookmarked = true;
            }
            else {
                removeFromTemplate(attribute);
            }
        }

        function removeFromTemplate(attribute) {
            delete api.selectedAttributes[attribute.metadata.attributeGroup][attribute.metadata.id];
            attribute.bookmarked = false;
        }

        function cancelTemplate() {
            clearData();

            if(api.onCancel) { api.onCancel(); }
        }

        function saveTemplate() {
            var attrObj = angular.copy(api.selectedAttributes);

            angular.forEach(attrObj, function(attributes) {
                angular.forEach(attributes, function(attribute){
                    delete attribute.bookmarked;
                    attribute.values = [];
                });
            });

            repository.addTemplate(api.templateName, attrObj);

            clearData();
            if(api.onTemplateSaved) { api.onTemplateSaved(); }
        }

        function clearData() {
            api.templateName = null;
            api.selectedAttributes = {};
        }
    }

    function navbarErrorService() {
        var api = {
            url: 'pages/global-search/partials/nav-bar-error.html',
            errors: null,
            selectAttribute: selectAttribute,
            close: close,
            createTask: createTask,
            onClose: null,
            onTaskInitiated: null
        }

        var selectedAttributes = {};

        return api;

        function createTask(ev) {
            var targetAttributes = _.isEmpty(selectedAttributes) ? api.errors : selectedAttributes;
            var description = 'Please rectify the errors in the following attributes.  ';
            var title = "Rectify the errors in the attributes";

            angular.forEach(targetAttributes, function (attributes, group) {
                angular.forEach(attributes, function(attribute){
                    description = description + ' ' + group + ' - '  + attribute.metadata.label + ','
                });
            });

            if(api.onTaskInitiated) {
                api.onTaskInitiated(ev, title, description);
            }
        }

        function selectAttribute(attribute) {
            if(attribute.selected && attribute.selected === true) {
                attribute.selected = false;
                delete selectedAttributes[attribute.metadata.attributeGroup][attribute.metadata.id];
            }
            else {
                attribute.selected = true;
                if(!selectedAttributes[attribute.metadata.attributeGroup]) {
                    selectedAttributes[attribute.metadata.attributeGroup] = {};
                }

                selectedAttributes[attribute.metadata.attributeGroup][attribute.metadata.id] = attribute;
            }
        }

        function close() {
            angular.forEach(api.errors, function(attributes){
                angular.forEach(attributes, function(attribute){
                    if(attribute.selected !== undefined) {
                        delete attribute.selected;
                    }
                })
            });

            navbarErrorService.errors = {};
            selectedAttributes = {};

            if(api.onClose) {
                api.onClose();
            }
        }
    }

    navbarMetadataService.$inject = ['$mdDialog'];
    function navbarMetadataService($mdDialog) {
        var api = {
            url: 'pages/global-search/partials/nav-bar-attribute-metadata.html',
            selectedAttribute: null,
            close: close,
            showLineage: showLineage,
            onClose: null
        }

        return api;

        function close() {
            api.selectedAttribute = null;

            if(api.onClose !== null) {
                api.onClose();
            }
        }

        function showLineage(lineage, event) {
            $mdDialog.show({
                templateUrl: 'pages/global-search/partials/attribute-lineage.html',
                parent: angular.element(document.body),
                targetEvent: event,
                clickOutsideToClose: true,
                onComplete: function(sco, elem) {drawLineageChart(lineage);}
            });
        }

        function drawLineageChart(lineage) {
            var margin = {top: 20, right: 20, bottom: 20, left: 150},
                width = 960 - margin.right - margin.left,
                height = 800 - margin.top - margin.bottom;

            var i = 0,
                duration = 750,
                root = lineage;

            var tree = d3.layout.tree()
                .size([height, width]);

            console.log(tree);

            var diagonal = d3.svg.diagonal()
                .projection(function(d) { return [d.y, d.x]; });

            var svg = d3.select("#lineage").append("svg")
                .attr("width", width + margin.right + margin.left)
                .attr("height", height + margin.top + margin.bottom)
                .append("g")
                .attr("transform", "translate(" + margin.left + "," + margin.top + ")");

            function collapse(d) {
                if (d.children) {
                    d._children = d.children;
                    d._children.forEach(collapse);
                    d.children = null;
                }
            }

            root.x0 = height / 2;
            root.y0 = 0;
            //root.children.forEach(collapse);
            update(root);

            d3.select(self.frameElement).style("height", "600px");

            function update(source) {

                // Compute the new tree layout.
                var nodes = tree.nodes(root).reverse(),
                    links = tree.links(nodes);

                // Normalize for fixed-depth.
                nodes.forEach(function(d) { d.y = d.depth * 180; });

                // Update the nodes…
                var node = svg.selectAll("g.node")
                    .data(nodes, function(d) { return d.id || (d.id = ++i); });

                // Enter any new nodes at the parent's previous position.
                var nodeEnter = node.enter().append("g")
                    .attr("class", "node")
                    .attr("transform", function(d) { return "translate(" + source.y0 + "," + source.x0 + ")"; })
                    .on("click", click);

                nodeEnter.append("circle")
                    .attr("r", 1e-6)
                    .style("fill", function(d) { return d._children ? "lightsteelblue" : "#fff"; });

                nodeEnter.append("text")
                    .attr("x", function(d) { return d.children || d._children ? -10 : 10; })
                    .attr("dy", ".35em")
                    .attr("text-anchor", function(d) { return d.children || d._children ? "end" : "start"; })
                    .text(function(d) { return d.name; })
                    .style("fill-opacity", 1e-6);

                // Transition nodes to their new position.
                var nodeUpdate = node.transition()
                    .duration(duration)
                    .attr("transform", function(d) { return "translate(" + d.y + "," + d.x + ")"; });

                nodeUpdate.select("circle")
                    .attr("r", 4.5)
                    .style("fill", function(d) { return d._children ? "lightsteelblue" : "#fff"; });

                nodeUpdate.select("text")
                    .style("fill-opacity", 1);

                // Transition exiting nodes to the parent's new position.
                var nodeExit = node.exit().transition()
                    .duration(duration)
                    .attr("transform", function(d) { return "translate(" + source.y + "," + source.x + ")"; })
                    .remove();

                nodeExit.select("circle")
                    .attr("r", 1e-6);

                nodeExit.select("text")
                    .style("fill-opacity", 1e-6);

                // Update the links…
                var link = svg.selectAll("path.link")
                    .data(links, function(d) { return d.target.id; });

                // Enter any new links at the parent's previous position.
                link.enter().insert("path", "g")
                    .attr("class", "link")
                    .attr("d", function(d) {
                        var o = {x: source.x0, y: source.y0};
                        return diagonal({source: o, target: o});
                    });

                // Transition links to their new position.
                link.transition()
                    .duration(duration)
                    .attr("d", diagonal);

                // Transition exiting nodes to the parent's new position.
                link.exit().transition()
                    .duration(duration)
                    .attr("d", function(d) {
                        var o = {x: source.x, y: source.y};
                        return diagonal({source: o, target: o});
                    })
                    .remove();

                // Stash the old positions for transition.
                nodes.forEach(function(d) {
                    d.x0 = d.x;
                    d.y0 = d.y;
                });
            }

            // Toggle children on click.
            function click(d) {
                if (d.children) {
                    d._children = d.children;
                    d.children = null;
                } else {
                    d.children = d._children;
                    d._children = null;
                }
                update(d);
            }
        }
    }

