            closeTemplateBar: closeTemplateBar,
            unloadTemplate: unloadTemplate,
            showAllErrors: showAllErrors,
            showError: showError,
            closeError: closeError,
            createTask: createTask,
            cloneItem: cloneItem,
            createClonedItem: createClonedItem,
            cancelClonedItem: cancelClonedItem,
            showMetadata: showMetadata,
            createItemUsingTemplate: createItemUsingTemplate,
            getAttributesWithErrors: getAttributesWithErrors,
            getAttributesWithNoValue: getAttributesWithNoValue,
            getRequiredAttributes: getRequiredAttributes,
            getOptionalAttributes: getOptionalAttributes,
