    searchItemFactory.$inject = ['$http'];
    function searchItemFactory($http) {
        var api = {
            search: search
        }
        
        return api;
        
        function search(searchText) {
            var request = {
                method: 'GET',
                url: 'data/global-search/' + searchText + '.json'
            }

            return $http(request)
                .then(
                    function(response) {
                        return response.data;
                    }
                )
                .catch(
                    function(err) {
                        console.log(err);
                        return null;
                    }
                )
        }
    }

    attributeContainer.$inject = ['$templateCache','$compile'];
    function attributeContainer($templateCache, $compile) {
        var ddo = {
            restrict: 'E',
            template: '<div id="{{attribute.metadata.id}}"></div>',
            scope: {
                attribute: '=',
                onBookmarked: '&',
                onShowError: '&',
                onShowMetadata: '&'
            },
            link: attributeLinkFn,
            replace: true
        }
        
        return ddo;
        
        function attributeLinkFn(scope, element, attrs) {

            loadTemplate();

            scope.bookMarkClicked = function() {
                if(scope.onBookmarked) {
                    scope.onBookmarked({attribute: scope.attribute});
                }
            }

            scope.showError = function() {
                if(scope.onShowError) {
                    scope.onShowError({attribute: scope.attribute});
                }
            }

            scope.showMetadata = function() {
                scope.onShowMetadata({attribute: scope.attribute});
            }

            function loadTemplate() {
                var templateName = getTemplate();
                var template = $templateCache.get('templateHeader') + $templateCache.get(templateName) + $templateCache.get('templateFooter');
                element.html(template);
                $compile(element.contents())(scope);
            }

            function getTemplate() {
                var template = null;
                switch (scope.attribute.metadata.field) {
                    case 'textbox':
                    case 'decimal':
                    case 'numeric':
                        template = 'global-search-textbox';
                        break;
                    case 'boolean':
                        template = 'global-search-switch';
                        break;
                    case 'select':
                        template = 'global-search-select';
                        break;
                    case 'listBox':
                        template = 'global-search-multi-select';
                        break;
                    default:
                        console.log(scope.attribute);
                        break;
                }

                return template;
            }
        }
    }

    function attributeFilter() {
        return function(attributes, property, value, filterType) {
            var returnVal = {};


            if(filterType === 'contains') {
                value = value.toLowerCase();

                var targetPropertyValue = null;
                angular.forEach(attributes, function(attribute, key) {
                    targetPropertyValue = _.get(attribute, property, undefined);
                    if(targetPropertyValue !== undefined && targetPropertyValue.toLowerCase().indexOf(value) !== -1) {
                        returnVal[key] = attribute;
                    }
                });
            }
            else if(filterType === 'equals') {
                var targetPropertyValue = null;
                angular.forEach(attributes, function(attribute, key) {
                    targetPropertyValue = _.get(attribute, property, undefined);
                    if(targetPropertyValue !== undefined && targetPropertyValue === value) {
                        returnVal[key] = attribute;
                    }
                });
            }
            else if(filterType === 'not-equals') {
                var targetPropertyValue = null;
                angular.forEach(attributes, function(attribute, key) {
                    targetPropertyValue = _.get(attribute, property, undefined);
                    if(targetPropertyValue !== undefined && targetPropertyValue !== value) {
                        returnVal[key] = attribute;
                    }
                });
            }

            return returnVal;
        }
    }

    function repository() {
        var api = {
            addTemplate: addTemplate,
            getTemplates: getTemplates
        }

        var templates = {};

        return api;

        function addTemplate(name, template) {
            templates[name] = null;
            templates[name] = template;

            console.log(templates);
        }

        function getTemplates() {
            return templates;
        }
    }
